    true,nt"url": null,nt"notes": "<p>The AIDS Public Information Data Set
    (APIDS) for years 1981-2002 on CDC WONDER online database contains counts of AIDS
    (Acquired Immune Deficiency Syndrome) cases reported by state and local health departments,
    by demographics; location (region and selected metropolitan areas); case-definition;
    month/year and quarter-year of diagnosis, report, and death (if applicable); and
    HIV exposure group (risk factors for AIDS).  Data are produced by the US Department
    of Health and Human Services (US DHHS), Public Health Service (PHS), Centers for
    Disease Control and Prevention (CDC), National Center for HIV, STD and TB Prevention
    (NCHSTP), Division of HIV/AIDS Prevention (DHP).</p>n",nt"license_title": "Other
